  obtenerProducto,
  editarProducto,
} = productosController;

router.route("/").get(listarProductos).post(crearProductos);

router
  .route("/:id")
  .delete(eliminarProductos)
  .get(obtenerProducto)
  .put(editarProducto);

export default router;

